pragma solidity 0.5.11;

import "./CustodianData.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract CustodianProxy is CustodianData {
    constructor(
        address[] memory _custodians,
        address[] memory _custodians_cold,
        address impl
    ) public {
        require(
            _custodians.length == _custodians_cold.length,
            "length not match"
        );
        // custodian key
        custodians = _custodians;
        custodians_cold = _custodians_cold;
        // member change nonce
        member_change_nonce = 0;
        // register 1820
        ERC1820_REGISTRY.setInterfaceImplementer(
            address(this),
            keccak256("ERC777TokensRecipient"),
            address(this)
        );
        // migration
        in_migration = true;
        // mintable
        mintable = true;
        // pause & set implementation
        pause();
        setImplementation(impl);
        // cfx sponsor
        address[] memory users = new address[](1);
        users[0] = address(0);
        SPONSOR.addPrivilege(users);
        // add whitelist
        _addWhitelisted(msg.sender);
        emit Constructed(msg.sender);
    }

    // get current implementation contract address
    function implementation() external view returns (address impl) {
        bytes32 slot = IMPLEMENTATION_SLOT;
        assembly {
            impl := sload(slot)
        }
    }

    function() external payable {
        assembly {
            let ptr := mload(0x40)
            let impl := sload(IMPLEMENTATION_SLOT)
            // (1) copy incoming call data
            calldatacopy(ptr, 0, calldatasize)

            // (2) forward call to logic contract
            let result := delegatecall(gas, impl, ptr, calldatasize, 0, 0)
            let size := returndatasize

            // (3) retrieve return data
            returndatacopy(ptr, 0, size)

            // (4) forward return data back to caller
            switch result
                case 0 {
                    revert(ptr, size)
                }
                default {
                    return(ptr, size)
                }
        }
    }
}

